import React from "react";
import ReactDOM from "react-dom";

import { BrowserRouter ,Routes , Route } from "react-router-dom";

import "./index.css";
import App from "./App";

ReactDOM.render(

    <BrowserRouter>
      <Routes>
        <Route path="/movie-browser-app" element={ <App /> }>
        </Route>
      </Routes>
    </BrowserRouter>,
  document.getElementById("root")
);
